import React from 'react'
import ReactDOM from 'react-dom'

let greeting=''
let date=new Date().getHours();
if(date>=1 && date<12){
    greeting='good morning'
}
else if(date>=12 && date<19){
    greeting='good afternoon'
}
else{
    greeting='good night'
}



ReactDOM.render(<>
    <h1>hello sir {greeting}</h1>


</>,document.getElementById('root'))
